export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},iQid692L46:{data:{id:423,attributes:{imdbId:"tt0398808",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTMzOTk1MzIyN15BMl5BanBnXkFtZTcwNTM3MjczMQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"85%"},{Source:"Metacritic",Value:"74\u002F100"}],item_lang:{data:{id:1086,attributes:{title:a,plot:"Jesse is picked on at school and had no friends until Leslie, the new girl, befriends him and they begin to come really close. They use their imaginations and create a world called Terabithia, only for the wonderful fantasy to end in disaster, tragedy and loss. But it's up to Jesse to remember what Leslie taught him and to stay happy.",slug:"bridge-to-terabithia"}}},books:{data:[{id:3482,attributes:{title:a,description:"The 40th anniversary edition of the classic Newbery Medal-winning title by beloved author Katherine Paterson, with brand-new bonus materials including an author's note by Katherine herself and a foreword by New York Times bestselling author Kate DiCamillo. Jess Aarons has been practicing all summer so he can be the fastest runner in the fifth grade. And he almost is, until the new girl in school, Leslie Burke, outpaces him. The two become fast friends and spend most days in the woods behind Leslie's house, where they invent an enchanted land called Terabithia. One morning, Leslie goes to Terabithia without Jess and a tragedy occurs. It will take the love of his family and the strength that Leslie has given him for Jess to be able to deal with his grief. Bridge to Terabithia was also named an ALA Notable Children’s Book and has become a touchstone of children’s literature, as have many of Katherine Paterson’s other novels, including The Great Gilly Hopkins and Jacob Have I Loved.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jEdNOQhEHNcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2009-10-06",publisher:h,subtitle:e}},{id:3483,attributes:{title:"Bridge to Terabithia Movie Tie-in Edition (rack)",description:"Now a major motion picture, discover the beloved Newbery Medal-winning story of Jess Aarons and Leslie Burke. Join Jess and Leslie as they form an unlikely friendship and create the imaginary land of Terabithia. There they rule as king and queen, until a terrible tragedy occurs that helps Jess understand just how much he has learned from Leslie.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pxLGNSITPkoC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2006-12-26",publisher:h,subtitle:e}},{id:3484,attributes:{title:a,description:"Jesse, alienated from the pragmatism of his family and rural Virginian culture, draws and dreams of becoming something special. Leslie, the new girl from the city and the ultimate outsider, opens a world of imagination, art, and literature for him. Together they create Terabithia, a fantasy kingdom where they are safe from those who don't understand them. Their friendship grows as Jesse's world expands. When tragedy strikes, the strength gained in Terabithia takes Jesse forward on his own and lets him share the magic of his dreams.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HZovYGOVgdQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Steve Liebman",b,"Stephanie S. Tolan"],firstBook:d,published:"1992-01-01",publisher:"Samuel French, Inc.",subtitle:"A Play with Music"}},{id:3485,attributes:{title:a,description:"One of the most celebrated Newbery Medal winners of all time gets a magical makeover in this new edition, complete with a reader's guide that's ideal for teachers, book clubs, or anyone looking for insight into this favorite book.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qGhxPIwXLikC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1979-01-01",publisher:"Manitoba Department of Education, Special Materials Services], 1981. (Winnipeg : University of Manitoba Computer Braille Services)",subtitle:e}},{id:3486,attributes:{title:a,description:"Literature guide that discusses the dramatic and fascinating story of friendship between Jesse Aarons and Leslie Burke.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=in6-JQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Marie-Helen Goyetche",b],firstBook:d,published:"2007-01-01",publisher:"Classroom Complete Press",subtitle:"Grades 5 - 6"}}]}}},meta:{}}},prerenderedAt:1681309153785}}("Bridge to Terabithia","Katherine Paterson","movie",null,"","series",1,"Harper Collins"))